// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";

contract LandRegistry is Ownable {
    struct Land {
        string ownerName;
        uint256 landArea;
        string district;
        string taluk;
        string village;
        uint256 blockNumber;
        uint256 surveyNumber;
        address ownerAddress;
        bool exists;
    }

    mapping(bytes32 => Land) public lands; // Land ID is a Keccak hash
    mapping(bytes32 => bool) public landExists; // Track registered hashes

    event LandRegistered(bytes32 indexed landId, address indexed owner, string ownerName);
    event OwnershipTransferred(bytes32 indexed landId, address indexed from, address indexed to);
    event NewLandNotification(address indexed admin, bytes32 indexed landId, string ownerName); // New event for admin notification

    constructor() Ownable(msg.sender) {}

    function registerLand(
        string memory _ownerName,
        uint256 _landArea,
        string memory _district,
        string memory _taluk,
        string memory _village,
        uint256 _blockNumber,
        uint256 _surveyNumber
    ) external {
        bytes32 landId = keccak256(abi.encodePacked(_blockNumber, _surveyNumber));
        require(!landExists[landId], "Land already registered");

        lands[landId] = Land({
            ownerName: _ownerName,
            landArea: _landArea,
            district: _district,
            taluk: _taluk,
            village: _village,
            blockNumber: _blockNumber,
            surveyNumber: _surveyNumber,
            ownerAddress: msg.sender,
            exists: true
        });
        landExists[landId] = true;

        emit LandRegistered(landId, msg.sender, _ownerName);
        emit NewLandNotification(owner(), landId, _ownerName); // Notify the admin
    }

    // Other functions (transferOwnership, getLand) remain unchanged
}

